%     Needham, and R. Fraile, editors, BMVC 2008: Proceedings of the 19th
%     British Machine Vision Conference, volume 1, pages 565-574, Malvern,
%     UK, September 2008.
%  Z. Kukelova, M. Bujnak, and T. Pajdla. Polynomial eigenvalue solutions to
%     minimal problems in computer vision. IEEE Trans. Pattern Analysis and
%     Machine Intelligence, 33 (12), 2011.

%  Adapted from http://cmp.felk.cvut.cz/~bujnam1/code/peig5pt.zip
%  by M. Bujnak, Z. Kukelova (c) Sep. 2008.

