%  Q2 - 3x5 matrix with 5 corresponding 2D points

Q1 = [-0.06450996083506   0.12991134106070  -0.01417169260989   0.02077599827229   0.15970376410206
      0.13271495297568   0.25636930852309  -0.00201819071777   0.14974189941659   0.17782283760921
      1.00000000000000   1.00000000000000   1.00000000000000   1.00000000000000   1.00000000000000];

Q2 = [0.01991821260977   0.29792009989498   0.14221131487001   0.09012597508721   0.15373963107017
      0.13855920297370   0.21684093037950   0.03902000959363   0.11407993279726   0.02622710108650
      1.00000000000000   1.00000000000000   1.00000000000000   1.00000000000000   1.00000000000000];

Q1 = Q1';
Q2 = Q2';

Q = [Q2(:,1).*Q1(:,1),...
    Q2(:,1).*Q1(:,2),...
    Q2(:,1).*Q1(:,3),...
    Q2(:,2).*Q1(:,1),...
    Q2(:,2).*Q1(:,2),...
    Q2(:,2).*Q1(:,3),...
    Q2(:,3).*Q1(:,1),...
